import React from "react";
import { Link } from "react-router-dom";

const NavBar = () => {
  return (
    <div>
      <h1>Stephan Manley</h1>
      <Link to="/">Home</Link>
      <Link to="/portfolio">Portfolio</Link>
      <Link to="/hobbies">Hobbies</Link>
      <Link to="/lgbtqia">LGBTQIA</Link>
    </div>
  );
};

export default NavBar;
